INSERT INTO `mdl_cache_text` (`id`, `md5key`, `formattedtext`, `timemodified`) VALUES
(1, '9ddbc4549b7a680d4c1ab908bca279ee', '<p>Here you can find various settings to change many of the colours found in this theme.</p>\n', 1403016648),
(2, '7e417a6825bc9c1d13e188438fbe87a1', '<p>This creates a dynamic slideshow of up to 4 slides for you to promote important elements of your site.</p>\n', 1403016648),
(3, '29eb99acfa924b9209f8e6f51fa6080e', '<p>This adds a custom content area inbetween the Slideshow and the Marketing boxes for your own custom content</p>\n', 1403016648),
(4, '050576f57a783232db5cb433f4208c2e', '<p>This theme provides the option of enabling three "marketing" or "ad" spots just under the slideshow.  These allow you to easily identify core information to your users and provide direct links.</p>\n', 1403016648),
(5, 'd8716256b1866f5de12529ac4450e477', '<p>Provide direct links to the core social networks that promote your brand.  These will appear in the header of every page.</p>\n', 1403016648),
(6, 'd59b01b4027ee4466f0b19640cebfe7c', '<p>If enabled this will allow you to set icons for each category of course.</p>\n', 1403016648),
(7, 'c14aeceba48baeaa76cd68bbf2e5f809', '<p>Have you got a web app on the App Store or Google Play Store?  Provide a link here so your users can grab the apps online</p>\n', 1403016648),
(8, '0f490335051cb1a8709026159746fd18', '<p>This will display an alert (or multiple) in three different styles to your users on the Moodle frontpage. Please remember to disable these when no longer needed.</p>\n', 1403016648),
(9, '7a0ffc273b618c1e65aa9d84f4804481', '<p>Here you can enable Google Analytics for your moodle site. You will need to sign up for a free account at the Google Analytics site (<a href="http://analytics.google.com" target="_blank">http://analytics.google.com</a>)</p>\n', 1403016648),
(10, '7088784e04c075cc90016a72cf938cb2', '<p>When players are enabled in these settings, files can be embedded using the media filter (if enabled) or using a File or URL resources with the Embed option. When not enabled, these formats are not embedded and users can manually download or follow links to these resources.</p>\n\n<p>Where two players support the same format, enabling both increases compatibility across different devices such as mobile phones. It is possible to increase compatibility further by providing multiple files in different formats for a single audio or video clip.</p>\n', 1403016648),
(11, '74411bcd162b03a9f2c983b4c1511f87', '<div class="no-overflow"><div class="text_to_html"><p>Online Tutoring That Delivers Results</p></div></div>', 1403019697),
(12, '2d67083378c33b0965ff56146a91148d', '<div class="no-overflow"><p>new CAtegory</p></div>', 1403011953),
