(103, '6f89184ed3b9c89bd62972c5f556c979', '<div class="no-overflow"><hr style="width: 100%; height: 2px;" />\r\n<h1 style="text-align: center;">Algebra A (A)</h1>\r\n<p>Algebra A (A) is the first semester of Algebra A. </p>\r\n<p>Algebra A and Algebra B make up a two-year Algebra program. The main goal of Algebra is to develop fluency in working with linear equations. This 2 year program gives students the opportunity to study, learn, and practice algebraic concepts at a pace that allows additional learning activities, projects, and discussions. In this course, students will work with tables, graphs, and equations and solve linear equations and inequalities and systems of linear equations and inequalities. Throughout the course, students will have opportunities to apply mathematical skills and make meaningful connections to life’s experiences.</p>\r\n<h4 style="text-align: left;"></h4>\r\n<p><a href="http://creativecommons.org/licenses/by/3.0/" rel="license"><img src="http://i.creativecommons.org/l/by/3.0/88x31.png" style="border-width: 0pt;" alt="Creative Commons License" /></a><br /><span size="1" style="font-size: xx-small;"><span property="dc:title" xmlns:dc="http://purl.org/dc/elements/1.1/">Algebra A (A)</span> course materials created by the <a rel="cc:attributionURL" property="cc:attributionName" href="http://www.openhighschool.org/" xmlns:cc="http://creativecommons.org/ns#" target="_blank">Open High School of Utah</a> are licensed under a <a href="http://creativecommons.org/licenses/by/3.0/" rel="license">Creative Commons Attribution 3.0 Unported License</a>. This course contains open educational resources produced by other organizations which may use a different open license. Please confirm the license status of these third-party resources before reusing them. See <a title="OpenCourseWare" href="http://www.openhighschool.org/general-information/opencourseware/" target="_blank">OpenCourseWare</a> for additional information about licensing. For materials in this course from <a xmlns:dc="http://purl.org/dc/elements/1.1/" href="http://www.hippocampus.org" rel="dc:source">www.hippocampus.org</a>, terms of use are available at <a href="http://www.hippocampus.org/jsp/terms-hippo.jsp">http://www.hippocampus.org/jsp/terms-hippo.jsp</a>.</span></p>\r\n<hr style="width: 100%; height: 2px;" /></div>', 1403012407),
